import DropdowMenu from "./DropdownMenu";

export const Navbar = () => {
  return (
    <nav className="navbar">
      <DropdowMenu />
      <input
        type="search"
        placeholder="Search product..."
        className="search-bar"
      />
      <button>My account</button>
      <button>Favorites</button>
      <button>Cart</button>
    </nav>
  );
};
